import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  IconButton,
  InputAdornment,
  Snackbar,
  Alert
} from '@mui/material';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';

export default function LoginForm({ onClose, onLoginSuccess }) {
  const [mostrarClave, setMostrarClave] = React.useState(false);
  const [errorLogin, setErrorLogin] = React.useState('');
  const [loginExitoso, setLoginExitoso] = React.useState(false);
  const [emailActual, setEmailActual] = React.useState(localStorage.getItem('token-email') || '');

  const onSubmit = (data) => {
    const email = data.email;
    const password = data.password;

    if (email === 'demo@usuario.com' && password === '1234') {
      localStorage.setItem('token', 'demo-token');
      localStorage.setItem('token-email', email);
      setEmailActual(email);
      setLoginExitoso(true);

      if (onLoginSuccess) onLoginSuccess();
      if (onClose) onClose();
      window.dispatchEvent(new Event('storage'));
    } else {
      setErrorLogin('Usuario o contraseña incorrectos');
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('token-email');
    setEmailActual('');
    window.dispatchEvent(new Event('storage'));
  };

  return (
    <Box
      component="form"
      onSubmit={(e) => {
        e.preventDefault();
        const data = {
          email: e.target.email?.value,
          password: e.target.password?.value
        };
        onSubmit(data);
      }}
      noValidate
      aria-labelledby="titulo-login"
      role="form"
      sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}
    >
      <Typography id="titulo-login" variant="h5" sx={{ fontWeight: 'bold' }}>
        Iniciar sesión
      </Typography>

      {!emailActual && (
        <>
          <TextField
            name="email"
            label="Correo electrónico"
            type="email"
            fullWidth
            autoFocus
            autoComplete="username"
            inputProps={{ 'aria-label': 'Campo correo electrónico' }}
          />

          <TextField
            name="password"
            label="Contraseña"
            type={mostrarClave ? 'text' : 'password'}
            fullWidth
            autoComplete="current-password"
            inputProps={{ 'aria-label': 'Campo contraseña' }}
            InputProps={{
              endAdornment: (
                <InputAdornment position="end">
                  <IconButton
                    onClick={() => setMostrarClave(!mostrarClave)}
                    aria-label={mostrarClave ? 'Ocultar contraseña' : 'Mostrar contraseña'}
                  >
                    {mostrarClave ? <VisibilityOffIcon /> : <VisibilityIcon />}
                  </IconButton>
                </InputAdornment>
              )
            }}
          />

          <Button
            type="submit"
            variant="contained"
            color="primary"
            fullWidth
            aria-label="Botón para iniciar sesión"
          >
            Iniciar sesión
          </Button>

          <Typography variant="body2" align="center" sx={{ mt: 2 }}>
            ¿No te has registrado?{' '}
            <a href="/registro" style={{ fontWeight: 'bold', color: '#388e3c' }}>
              Regístrate aquí
            </a>
          </Typography>
        </>
      )}

      {emailActual && (
        <>
          <Typography variant="body1" align="center" sx={{ fontWeight: 'medium' }}>
            Sesión iniciada como <strong>{emailActual}</strong>
          </Typography>

          <Button
            variant="outlined"
            color="error"
            fullWidth
            onClick={handleLogout}
            sx={{ mt: 1 }}
          >
            Cerrar sesión
          </Button>
        </>
      )}

      <Snackbar
        open={!!errorLogin}
        autoHideDuration={4000}
        onClose={() => setErrorLogin('')}
        anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}
      >
        <Alert severity="error" variant="filled" onClose={() => setErrorLogin('')}>
          {errorLogin}
        </Alert>
      </Snackbar>

      <Snackbar
        open={loginExitoso}
        autoHideDuration={4000}
        onClose={() => setLoginExitoso(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" sx={{ bgcolor: '#388e3c', color: 'white' }}>
          ¡Has iniciado sesión correctamente!
        </Alert>
      </Snackbar>
    </Box>
  );
}
